import React from 'react'

interface Persona { 
    nombreCompleto: string, 
    edad: number, 
    direccion: { 
        pais: string, 
        estado: string,  
        ciudad: string, 
        calle: string, 
        numero: number 
    } 
}

export const ObjetosLiterales = () => {

    const persona = { 
        nombre: 'Christopher', 
        edad: 22, 
        direccion: { 
            pais: 'Mexico', 
            estado: 'Nayarit', 
            ciudad: 'Tepic', 
            direccion: 'Conocido No. 888' 
        }
    }
    
  return (
    <div>
        <h3>Objetos Literales</h3>
        <code>
            <pre>
                {JSON.stringify(persona, null, 2)}
            </pre>
        </code>
    </div>
  )
}
